  `hits` int(11) DEFAULT '0' COMMENT '总点击',
  `yhits` int(11) DEFAULT '0' COMMENT '月点击',
  `zhits` int(11) DEFAULT '0' COMMENT '周点击',
  `rhits` int(11) DEFAULT '0' COMMENT '日点击',
  `shits` int(11) DEFAULT '0' COMMENT '收藏人气',
