  `nums` int(11) DEFAULT '0' COMMENT '章节总数',
  `score` decimal(2,1) DEFAULT '9.8' COMMENT '总得分',
  `zyid` varchar(64) DEFAULT '0' COMMENT '采集资源ID',
  `type` tinyint(1) DEFAULT '1' COMMENT '资源站标识 1-lezhinus 2-bomtoon',
