  `serial_sort` int(11) DEFAULT '0' COMMENT '连载排序',
  `end_sort` int(11) DEFAULT '0' COMMENT '完结排序',
  `gender` tinyint(1) DEFAULT '1' COMMENT '性别频道 1-女 2-男 3-通用',
  `is_exist` tinyint(1) DEFAULT '0' COMMENT '用于判断采集漫画是否存在',
  `is_collection` tinyint(1) DEFAULT '1' COMMENT '是否采集 0-否 1-是',
