DROP TABLE IF EXISTS `comic_chapter`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `comic_chapter` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `mid` int(11) DEFAULT '0' COMMENT '漫画ID',
  `xid` int(11) DEFAULT '0' COMMENT '排序ID',
  `name` varchar(128) DEFAULT '' COMMENT '标题',
  `pic` varchar(255) DEFAULT '' COMMENT '图片地址',
  `pnum` int(11) DEFAULT '0' COMMENT '图片数量',
  `zyid` varchar(64) DEFAULT '0' COMMENT '资源站ID',
  `addtime` int(11) DEFAULT '0' COMMENT '入库时间',
  `up` tinyint(1) DEFAULT '0',
  `type` varchar(20) DEFAULT '' COMMENT '来源',
  `task_status` tinyint(1) DEFAULT '0' COMMENT '任务状态 0-无 1-处理中',
  `ctime` datetime DEFAULT NULL COMMENT '源创建时间',
  `state` tinyint(1) NOT NULL,
  `last_modified_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '最后修改时间',
  `last_modified_by` varchar(50) NOT NULL COMMENT '最后修改人',
  `created_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `created_by` varchar(50) NOT NULL COMMENT '创建人',
  PRIMARY KEY (`id`),
  KEY `xid` (`xid`) USING BTREE,
  KEY `mid` (`mid`) USING BTREE,
  KEY `up_type` (`up`,`type`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=297 DEFAULT CHARSET=utf8 COMMENT='漫画章节';
